#include   <stdio.h>
#include  <stdlib.h>
#include  <string.h>

char *ppsz[14];

void monitor();

//////////////////////////////////////////////////////////
int main()                                              //
{
    
    
    char *psz = (char*)malloc(15);
    
    strcpy(psz, "January");
    
    ppsz[1] = psz; 
    
    monitor();
    
}






//////////////////////////////////////////////////////////
void monitor()
{
     for(int i = 1; i < 2; i++)
     {
         printf("%s\n", ppsz[i]);    
     }
     
}










